window.bookSummaryJSON = "<p>There's a different schemer or slimeball behind every door: cocaine duckpins who have survived only by the dumbest fortune, hard-luck gigolos desperate to score, undercover cops busting undercover cops who are running sting operations on undercover cops. And just down the row, local historian and spree killer Serge A. Storms -- who has stopped keeping up with his meds -- is still looking for a briefcase stuffed with five million dollars...and is now capable of wreaking more havoc than hurricane Rolando-berto, the big wind gathering force offshore, just waiting for the opportunity to blow everything straight to hell.</p>"; 
